description:
Get hours of relaxation and fun! Discover tons of 2D and 3D artworks or create your own pixel art. Color. Relax. Enjoy!


Features:

- Great variety of coloring pages for any taste: Mandalas, Patterns, Animals, Birds, Flowers, Places, Food and many others;
- Tons of amazing pictures. Explore daily updated collection of new images for you to color;
- 3D coloring. Get an amazing coloring experience with 3D images;
- Pixel Art Camera. Take selfies or use any photos to color your own pixel pictures!
- Various coloring tools. Use Magic Wand to paint multiple neighboring cells of the same number and Color Splash to color multiple neighboring cells of any numbers;
- Quick sharing. Share your timelapse video with friends on social networks or email in just one tap;
- Easy coloring. Enjoy intuitive design and smooth performance of Pixel Art.

Painting has never been easier! No stress of picking up colors. Just relax and enjoy!

Pixel Art Premium
Pixel Art Premium Subscription allows you to unlock everything, access daily updates and remove ads. Weekly subscription with 3-day free trial period is $7.99, monthly $15.99, and annually $46.99 or equal to the same price tier as Apple App Store Matrix determines as the equivalent of subscription price in USD. Payment will be charged to iTunes Account at confirmation of purchase.
Subscription automatically renews unless auto-renew is turned off at least 24-hours before the end of the current period. Account will be charged for renewal within 24-hours prior to the end of the current period.

Subscriptions may be managed by you and auto-renewal may be turned off by going to iTunes Account Settings. For more information please visit the link https://support.apple.com/en-us/HT202039. No cancellation of the current subscription is allowed during the active subscription period. Unused portion of a free-trial period will be forfeited when a user decides to subscribe.

EULA: https://easybrain.com/terms.html
Privacy Policy: https://easybrain.com/policy.html

Walk your way from poverty to wealth!

Find your first job, climb up the career ladder, learn how to organize your time effectively. Check out the luxurious lifestyle: spend money on expensive cars, houses and helicopters, fashionable suits. Don't fool around and reach success!

Business simulator:
− Your goal is to become a millionaire, breaking your way right from the poverty level;
− Find your own ways to earn a living;
− Buy new clothes, houses, cars;
− Graduate from university, learn new things and grow personally to earn even more;
− Play and win at the casino simulator;
− Climb up the career ladder;
− Find a girlfriend and make a family together;
− Adopt a dog or a cat;
− Don't forget to do the health check, take care of your character and spend time relaxing at resorts;
− Create your business and make your first million;
− Practice regularly to succeed in life with 'HIT THE BANK'!

Puzzle+ is just like a real jigsaw on your iPad! Just the way you like it. More than 1000 pieces game. Ability to add your own images. 

We've created this app for you to make it possible to play your favorite game anywhere and anytime. It fully simulates the real puzzles and, at same time, the  app uses all advantages of iPad to make the playing of your favorite game as convinient as it has ever been possible.   

Features: 
- ability to add your own images; 
- ability to share the images and packages (email, Facebook, Twitter); 
- Constantly updated pictures gallery; 
- 8 levels of complexity: from  20 pieces up to 1110 pieces, available for any puzzle; 
- Zoom in/out function;

If you want to quit smoking, then this application is what you really need
The application allows you to watch:
- how much time has passed since you smoked your last cigarette.
- the number of cigarettes that you did not smoke.
- the amount of money saved.
- the amount of tar and nicotine that did not enter your body.
- how much time you saved.
- how long have you extended your life.
Besides, with this application:
- you may set your goals and track progress towards your goals;
- you will get methods of quitting tobacco, the key ideas of the method invented by Allen Carr;
- you may monitor the improvement of your health;
- you will have the information about the benefits of quitting smoking;
- you may read the description of more than 80 diseases caused by smoking;
- you will know the facts about the harm caused by smoking;
- you will know the benefits of quitting;
- you will get tips for a former smoker;
- you will enjoy quotes about tobacco;
- you will access tests and calculators for smokers;
- you will see pictures, demotivators and videos about the harm caused by tobacco.
The application has a stylish and easily customizable desktop widget, allowing you to quickly access the information you are interested in.
Be aware that anyone can quit smoking
Let's quit smoking together

IDPhoto Wizard provides a fool-proof ID card, passport or Visa photo production wizard.

Portrait separation from the background
IDPhoto Wizard allows you to extract the portrait from the background with a few clicks. For edge and area details, you can use the brush and hair brush for further refinement.

Background style
IDPhoto Wizard provides nearly 20 different styles of background canvas:
* Solid white, blue, red or gray;
* Back spotlight blue, red or gray;
* Bottom spotlight blue, red or gray;
* It also supports transparent background;
* More styles will be online soonâ€¦

Beautify
IDPhoto Wizard supports the facial beautify function. You can easily adjust the skin smoothing, skin whitening, saturation and contrast parameters to create extraordinary portraits.

Clothing function
The current version of the App contains 40+ sets of formal men's and women's business wear, more materials will be added in the later releases.
1. You should first wear a low collar costume and take a photo;
2. Select clothing for replacement;
3. Use the brush to erase the extra pixels on the edge;
4. Replace with the desired background canvas.

Photo specification
IDPhoto Wizard supports one-click ratio cropping and resizing of 30+ common photo formats. For example, one inch, two inches, one inch-, one inch+, two inches-, US visa, UK visa, Schengen visa, Japanese visa, Canada Visa, Australia visa, etc.
Steps of usage:
1. You first tap the Aspect-ratio Crop button to crop your photo according to the photo requirement, such as the US visa;
2. Tap resize button to adjust the photo to standard 50mm x 50mm or 590x590 pixels  (Note: based on 300dpi);
3. Export the photo

Export format and quality compression
IDPhoto Wizard supports to save user photos as JPG or PNG
* The PNG file format contains an alpha channel for saving transparent background photos. The user can first separate the portrait from the background and set the background to be transparent and export in PNG format.
* JPG selection has 9 scale image quality options that allows you to compress the image file size.

More features are still in development. Stay tune.
